"use strict";

function maxPower(s) {
    let ans = 0, t = 0;
    for (let i = 0; i < s.length; i++) {
        let c = s[i];
        if (i === 0 || c === s[i - 1]) {
            t += 1;
        } else {
            t = 1;
        }
        ans = Math.max(ans, t);
    }
    return ans;
}
